import React from 'react';
import './tracking.css';

class Tracking extends React.Component{
  constructor(props){
    super(props);
  }

  render(){
    return(
      <div class="container px-1 px-md-4 py-5 mx-auto" id="track">
          <div class="card">
              {this.props.data.TrackingPackage.map((detail)=>{
                return(
              <div class="row d-flex justify-content-between px-3 top">
                  <div class="d-flex">
                      <h5>ORDER <span class="font-weight-bold">{detail.Order_ID}</span></h5>
                  </div>
                  <div class="d-flex flex-column text-sm-right">
                      <p class="mb-0">Expected Arrival <span>{detail.arrival_date}</span></p>
                      <p>ID number:<span>{detail.User_ID}</span></p>
                      <p>address:<span>{detail.address}</span></p>
                  </div>
              </div>
                  )})}
              <div class="row d-flex justify-content-center">
                  <div class="col-12">
                      <ul id="progressbar" class="text-center">
                          <li class="active step0"></li>
                          <li class="active step0"></li>
                          <li class="active step0"></li>
                          <li class="step0"></li>
                      </ul>
                  </div>
              </div>
              <div class="row justify-content-between top">
              {this.props.data.Tracking.map((items)=>{
                return(
                  <div class="row d-flex icon-content"> <img src={items.url}/>
                      <div class="d-flex flex-column">
                          <p class="font-weight-bold">{items.status}</p>
                      </div>
                  </div>
                )
              })}
              </div>
          </div>

      </div>
    )
  }
}

export default Tracking
